import React from 'react';
import {cre} from 'react-dom/client';
import {BrowserRouter} from 'react-router-dom';
import App from './App';

const root = createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter basename="/Nail-Art">
    <App />
  </BrowserRouter>
);
